// src/index.jsx
import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Importa Router y Routes
import App from './App';
import UserDetail from './Components/UserDetail'; // Importa UserDetail

ReactDOM.render(
  <Router>
    <Routes>
      <Route path="/" element={<App />} />
      <Route path="/users/:id" element={<UserDetail />} /> {/* Ruta para UserDetail */}
    </Routes>
  </Router>,
  document.getElementById('root')
);
